const url = 'http://app.linkedin-reach.io/words'
const path = '/words'
const param = '?difficulty='

class Game extends Component {       
    constructor(props){
        super(props)
        this.state = {
            currentWord: ""
        }
    }

    componentDidMount(){
        fetch(path, {
            method: 'GET'
        })
        .then((data)=>{
            console.log(data);
            var words = data.split(" ");
            return words[Math.random * words.length]
        })
        .then((word)=>{
            this.setState({currentWord: word})
        })
    }

    render(){
        return (
            <div>
                Game render
            </div>
        )
    }
}


